  \"2015-10-29T05:53:28.840097\",\n\t\"name\": \"office-of-planning-development-geographic-information-gateway\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Geographic Information Gateway (Gateway)
  is a state-of-the-art website providing public access to data, real-time information,
  interactive tools, and expert knowledge relevant to the Office of Planning and Developmentu2019s
  activities throughout New York State. Interactive map viewers enable users to easily
  download, visualize, and explore geographic data. A Latest Conditions page provides
  access to real-time information across the State, such as water quality, tide levels,
  and beach conditions. Also included on this site are illustrated stories, which
  highlight case studies, showcase community success stories, and demonstrate how
  the Office uses available geographic information to improve planning and decision-making.
  The Gatewayu2019s suite of information and tools serves as a valuable resource for
  New York communities, an educational resource for schools and universities, and
  a guide for the responsible development of the Stateu2019s resources.\",\n\t\"license_title\":
